import React, { useState } from 'react';
import './App.css';

function App() 
{
  const [docs, setDocs] = useState([
    {
      id: 1,
      name: "ahoj.txt",
      author: "Feri",
      importance: 10
    },
    {
      id: 2,
      name: "money.xlsx",
      author: "Feri",
      importance: 20
    },
    {
      id: 3,
      name: "react_Is.cool",
      author: "Jozi",
      importance: 100
    }
  ]);

  const handleSubmit = () => {
    alert("hello");
  };

  const printDocs = docs.map(doc => (
    <li className="li_name" key={doc.id}>{doc.name}</li>
  ));

  return(
    <>

      <div>
        <h1>Hello, React!</h1>
        <br/>
        <br/>
        <h2>Your documents: </h2>

        <ul>
          {printDocs}
        </ul>

        <p className="text">Add document</p>
        <button onClick={handleSubmit}>Add</button>
      </div>




    </>
  );
}

export default App;
